using namespace std;

bool findMach(string b ,string a){
    if(a.size()<b.size())
        return false;
    int c =0;
    for (int i = 0; i < a.size(); ++i) {
        if(a[i]==b[c]){
            while(a[i]==b[c])
            {
                c++,i++;
                if(c==b.size()){
                    return true;
                }
            }
//            c=0;
        }
    }
    return false;


}

int numMatchingSubseq(string s, vector<string>& words) {
    int c =0;
    for(auto it : words)
    {
        if(findMach(s,it))
            c++;
    }
    return c;

}
